import React, { useEffect, useState } from 'react'
import {
  InnerBoxContainer,
  InnerBoxHeader,
  InnerBoxTitle,
  MainContainer,
  Margin36,
  SubTitle,
} from '../../../../../component/styledComponent'
import { useMonth } from '../../../../../hooks/useMonth'
import { WeekView } from './week'

export const CalendarView = () => {
  const { weekList, year, month, setYear, setMonth } = useMonth()
  useEffect(() => {
    setMonth(5)
  }, [])

  console.log(weekList)

  return (
    <MainContainer>
      <InnerBoxHeader>
        <InnerBoxTitle>달력</InnerBoxTitle>
      </InnerBoxHeader>
      <InnerBoxContainer>
        <Margin36 />
        <SubTitle>
          {year}년 {month}월
        </SubTitle>
        <Margin36 />
        {weekList.length !== 0 &&
          weekList.map((week: number[]) => {
            ;<WeekView week={week} />
          })}
      </InnerBoxContainer>
    </MainContainer>
  )
}
